package com.carSale.Model;import javax.persistence.*;@Entity@Table(name = "car")public class Car {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    @Column(name = "Id", updatable = false, nullable = false)    private int id;    @Column(name = "Name")    private String name;    @Column(name = "CarType")    private String car_type;    @Column(name = "Price")    private String price;    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getCar_type() {        return car_type;    }    public void setCar_type(String car_type) {        this.car_type = car_type;    }    public String getPrice() {        return price;    }    public void setPrice(String price) {        this.price = price;    }}